import type { FeaturedStory } from "../../lib/featured-stories";

// Stack chip component for easy customization
interface StackTool {
  name: string;
  icon: string | ReactNode; // Can be text/emoji or SVG component
}

function StackChip({ tool }: { tool: StackTool }) {
  return (
    <div className="stack-chip">
      <div className="stack-chip-icon">
        {typeof tool.icon === 'string' ? tool.icon : tool.icon}
      </div>
      <span className="stack-chip-name">{tool.name}</span>
    </div>
  );
}

function isExternalUrl(src: string) {
  return src.startsWith('http://') || src.startsWith('https://');
}

function StoryCard({ story }: { story: FeaturedStory }) {
  return (
    <a href={story.url} target="_blank" rel="noopener noreferrer" className="story-card">
      <div className="story-card-thumbnail">
        <Image
          src={story.thumbnail}
          alt={story.title}
          width={320}
          height={180}
          className="story-card-image"
          unoptimized={isExternalUrl(story.thumbnail)}
        />
      </div>
      <div className="story-card-info">
        <span className="story-card-title">{story.title}</span>
        <span className="story-card-site">{story.site}</span>
      </div>
    </a>
  );
}

// Publication logo component that handles both string paths and SVG elements
function PublicationLogo({ logo, alt }: { logo: string | ReactNode; alt: string }) {
  if (typeof logo === 'string') {
    return (
      <Image 
        src={logo} 
        alt={alt}
        width={200}
        height={80}
        className="publication-logo-image"
      />
    );
  }
  return <div className="publication-logo-image publication-logo-svg-wrapper">{logo}</div>;
}

